import "./Home.css";
import Social from "./Social";
import Navbar from "./Navbar";

function Home() {
  return (
    <div className="all">
      <Navbar />
      <div className="text">
        <div className="text-kr">
          <h1>갓세븐</h1>
        </div>
        <div className="text-en">
          <h1>GOT7</h1>
        </div>
      </div>
      <div className="home-button">
        <button>HOME FEED</button>
      </div>
      <Social />
    </div>
  );
}
export default Home;
